import React from "react"
import {Formik} from "formik"
import * as Yup from "yup"

const Validation = () => (
    <Formik 
     initialValues = {{email: "", password: ""}}
     onSubmit = {(values, { setSubmitting}) => {
         setTimeout(() => {
             console.log("Logged in", values)
         }, 500)
     }}
    >

    </Formik>
)


export default Validation
